import React from "react";
import "../styles/Card.css";
const SingleCard = (props) => {
  return (
    <div>
      <div className="card_team mt-5">
        <div className="imgBx">
          <img src={props.imageURL} alt="images" />
        </div>
        <div className="details">
          <h2>
            {props.name}
            <br />
            <span>{props.post}</span>
          </h2>
        </div>
      </div>
    </div>
  );
};





const detail = [
  {
    name: "NAYEL HASHMI",
    post: "President",
    imageURL: "images/Directorate/p1.jpg",
  },
  {
    name: "DUA SIDDIQUI",
    post: "Vice President",
    imageURL:"images/Directorate/p2.jpg"
  },
  {
    name: "M.ABDULLAH HAYAT",
    post: "General Secretary",
    imageURL:"images/Directorate/p3.jpg",
  },
  {
    name: "MUHAMMMAD USMAN",
    post: "Treasurer",
    imageURL:"images/Directorate/p7.jpg",
  },
  {
    name: "KHURRAM MERAJ",
    post: "Chair Memberships",
    imageURL: "images/Directorate/p4.jpg",
  },
  {
    name: "ABDUL SUBHAN",
    post: "Chair Logistics",
    imageURL: "images/Directorate/p5.jpg",
  },
  {
    name: "SYED AUN HASHMI",
    post: "Web master/Chair Technical",
    imageURL:"images/Directorate/p6.jpg",
  },
  {
    name: "SYED MUHAMMAD MUNEEB",
    post: "Chair Events",
    imageURL: "images/Directorate/p8.jpg",
  },
  {
    name: "TAZMEEN FATIMA",
    post: "Chair Academics",
    imageURL:"images/Directorate/p9.jpg",
  }
];

const ExCards = () => {
  return (
    <>
      <div className="cards-main">
        {detail.map((i) => {
          return <SingleCard key={i.name} name={i.name} post={i.post} imageURL={i.imageURL}/>;
        })}
      </div>
    </>
  );
};

const Teams = () => {
  return (
    <div style={{marginTop:'100px'}}>
      <h1
        style={{
          fontSize: "60px",
          textAlign: "center",
          color: "rgb(153, 0, 0)",
          letterSpacing: "10px",
        }}
      >
        COMPLETE TEAM
      </h1>
      <p
        style={{
          marginTop: "30px",
          fontSize: "20px",
          textAlign: "center",
          color: "#000",
          fontWeight: "bold",
          fontFamily: "Arial",
        }}
      >
        Meet Our Complete Team
      </p>
      {/* EXECUTIVE BODY  */}
      <h1
        style={{
          marginTop: "70px",
          fontSize: "40px",
          textAlign: "center",
          color: "rgb(153, 0, 0)",
          fontWeight: "50",
        }}
      >
        EXECUTIVE BODY
      </h1>

      <div style={{ marginTop: "80px" }}>
        <ExCards />
      </div>
      {/* DIRECTORATE  */}
      {/* <h1
        style={{
          marginTop: "70px",
          fontSize: "40px",
          textAlign: "center",
          color: "#122973",
          fontWeight: "50",
        }}
      >
        DIRECTORATE
      </h1>

      <div style={{ marginTop: "80px" }}>
        <DirCards />
      </div> */}
    </div>
  );
};

export default Teams;
